  , Asset "BridgeableTokens" 0x93fb7295859b2d70199e0a4883b7c320cf874e6c "ETHST" "<h4><strong><span style=\\\\\"color: rgb(29, 28, 29); font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; color: rgb(29, 28, 29)\\\\\">Ethereum Staking on Mercata</span></strong></h4><p><span style=\\\\\"color: rgb(29, 28, 29); font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; color: rgb(29, 28, 29)\\\\\">Mercata is expanding its asset offerings with staked Ethereum (ETHST). By staking Ethereum on Mercata, users can earn additional CATA rewards while also benefiting from Ethereum price movements.</span></p><p><span style=\\\\\"color: rgb(29, 28, 29); font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; color: rgb(29, 28, 29)\\\\\">Here\8217s how it works:</span></p><br><ol><li><p>1. Buy and Stake Ethereum<ul><li> \8226 Users can purchase Ethereum directly through Ethereum mainnet. Once purchased, connect the wallet to Mercata by pressing the Connect Wallet button. Once connected, ETH can seamlessly be transferred to the Mercata escrow wallet by pressing the Bridge button where wrapped tokens that represent your staked Ethereum will not be reflected on your Mercata account and in your Mercata Wallet.</p></li></ul></li><li><p>2. Wrapped Ethereum Integration<ul><li> \8226 The wrapped tokens are securely managed and attributed back to your Mercata account, ensuring they are visible and accessible both within the Mercata Marketplace and your crypto wallet.</p></li></ul></li><li><p>3. Earn While You Stake<ul><li> \8226 Staked Ethereum provides an APY in CATA rewards.</li><li> \8226 Users can also borrow up to 30% of their staked Ethereum\8217s value to purchase other assets within Mercata, unlocking additional opportunities for growth and liquidity.</p></li></ul></li></ol><p><span style=\\\\\"color: rgb(29, 28, 29); font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; color: