  , Asset "Clothing" 0x64d2c2f644b4a37a35404ec8112b5a5ae69a5c9a "Limited Edition Batman Core Bomber" "<p>Channel Gotham\8217s raw, urban energy with the <em>Limited Edition Batman Core&nbsp; Bomber Jacket,</em> designed for fans who thrive on the grit and graffiti-streaked edges of the DC universe. This exclusive piece combines the sleek style of a classic bomber with bold, graffiti-inspired graphics featuring Batman and his most notorious adversaries\8212Joker, Harley Quinn, and Penguin\8212adding an edgy, streetwear vibe to an iconic look.</p><p></p><p>Crafted in deep Gotham black, this jacket is brought to life with vibrant, spray-painted details that capture the chaos of Gotham\8217s streets and the battle between hero and villain. The high-quality fabric and insulated lining provide comfort for city nights or cooler weather, while the graffiti artwork and subtle nods to Gotham\8217s most infamous faces make this a standout piece in any fan\8217s collection. With limited availability, this bomber jacket is a rare find for those who want to bring Gotham\8217s underground to life in their style.</p><p></p><p><strong>Features:</strong></p><ul><li><p>Midnight-black fabric with graffiti-inspired graphics of Batman, Joker, Harley Quinn, and Penguin</p></li><li><p>Streetwear-inspired design with vibrant, spray-paint style details</p></li><li><p>Insulated lining for comfortable, versatile wear</p></li><li><p>Limited edition \8211 perfect for collectors and die-hard DC fans</p></li></ul><p>This ultra light-weight bomber jacket is the modern play on the military inspired aviator jackets. Featuring tapered stretch hand and wait cuffs and the iconic collar. These water resistant Lightweight Bomber Jackets are made with 100% polyester fabric with a zip front closure. They are great for all weather conditions, soft on your skin, and great for layering.</p><p>&nbsp;</p><p>After buying your exclusive tokenized item on Mercata, you have a 90-day period to REDEEM it for the physical version. In order to, REDEEM the item simply press the redemption button on Mercata, and your item will be shipped to your home in 10-14 business days.</p>" (0) (fromList [(0,"https://fileserver.mercata.blockapps.net/highway/6e70921cb3614dedffb1f7e6d3669ba7801d4964b60fefd60d257ca3cfa47723.jpg"),(1,"https://fileserver.mercata.blockapps.net/highway/d222faf03ebf3b78ea86f9318e282505cbe4e38f28970a9a89d8840e513d7828.png")]) (fromList []) (fromList []) (fromList [("brand","Warner Bros"),("clothingType","Jacket"),("condition","New"),("isMint","True"),("mintAddress","64d2c2f644b4a37a35404ec8112b5a5ae69a5c9a"),("mintableMagicNumber","5578111059604171877"),("minterAddress","4fd5fffd7339f87cfda1a62e0dd1adc6390951fe"),("minterCommonName","jasmineredeem"),("redeemableMagicNumber","389104407046652472487013"),("redemptionService","f6a1a5c22f3f529a5faae65e288e6496c4d39c17"),("size","S"),("skuNumber","00001"),("utxoMagicNumber","1431590991")]) (fromList [(0x4fd5fffd7339f87cfda1a62e0dd1adc6390951fe,Balance  0x64d2c2f644b4a37a35404ec8112b5a5ae69a5c9a 0x4fd5fffd7339f87cfda1a62e0dd1adc6390951fe "jasmineredeem" (1))])
