  , Asset "Collectibles" 0xb3227ed63d80f9f79d4adb1b690c2eee2e4bd845 "Eggloo DIY Bubble Waffle Kit" "<h3 style=\\\"text-align: start\\\"><strong>Bubble Brigade</strong><br></h3><p style=\\\"text-align: start\\\">From the bustling streets of Hong Kong and Macau to Chinatowns across the globe, the egg bubble waffle is a long-standing favorite among dessert-craving street-cart connoisseurs. Now you can bring the social media\8211friendly treat home with an easy-to-use DIY cooking set. Packed with a specially designed iron that pops out waffles in spheres instead of squares, the kit includes two flavored mixes (original and chocolate) and all the tools you\8217ll need to make six to eight servings. Then, top your piping-hot puffy creations with ice cream, fresh fruit, or maybe something a little more savory. There are no wrong choices when it comes to toppings, so the possibilities are bound only by your imagination. Made in New York.<br><br><strong>Measurements</strong></p><p>Box: 15\\\" L x 10\\\" W x 4\\\" H, 6 lbs<br></p><h4><strong>Ingredients</strong></h4><p><strong>Original Waffle Mix</strong><br><span>Flour, sugar, custard powder, baking powder, tapioca starch, salt.</span></p><p><em>Contains wheat and eggs.</em><br></p><h4><strong>Notes</strong></h4><p><strong>Kit Includes:</strong><br>- Egg Waffle Pan<br>- Original Waffle Mix<br>- Chocolate Waffle Mix<br>- Mini Whisk<br>- 3 Waffle Cone Holders (for ice cream creations)<br>- Instruction Card<br><br>DIY Difficulty Level: Easy<br><br>Yields 6-8 Waffles for each mix.<br><br><em>What you'll need from home: eggs, milk, butter, toppings (optional), gas stove, and standard baking equipment.</em></p>" (0) (fromList [(0,"https://fileserver.mercata.blockapps.net/highway/9839a83f88e34d6a72299a61bfe6c5b31bae59b7dfd5a55b3b0145715d27489f.jpg"),(1,"https://fileserver.mercata.blockapps.net/highway/e01b1107045ce50b7134658b9dc0c348c3007f5c8ed30245b76a3fe4e3fba77a.jpg"),(2,"https://fileserver.mercata.blockapps.net/highway/5808c4e2