  , Asset "Metals" 0x2feb91ee68600c21ccd4de3faebc0d8680b1b4bf "Wyoming 1 Goldback Bill " "<p><span style=\\\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; color: rgb(34, 34, 34)\\\">Description:</span></p><p>The Goldback is a unique form of physical gold currency designed for everyday use. It circulates in select states, including Utah, Nevada, Wyoming, New Hampshire, and South Dakota, under local laws.</p><p>What sets the Goldback apart from other gold products is its use as a currency with interchangeable denominations, rather than relying on varying premiums based on gold content. For instance, the fifty denomination, representing 1/20th of an ounce of gold, can be exchanged for fifty of the one denomination, which is 1/1000th of an ounce.</p><p>Each Goldback is tied to the value of gold. One Goldback equals 1/1000th of a troy ounce of 24-karat gold, so 1,000 Goldbacks in any combination equals one full ounce of gold. This makes Goldbacks easy to use for small transactions, especially compared to other gold products, which often carry inconsistent premiums and are more challenging to exchange.</p><p>Because of their intrinsic value, Goldbacks can be bartered globally, making them more versatile than traditional gold coins or bars. Their flexibility and ease of use in smaller transactions give them a practical edge over other forms of physical gold. If you're considering adding to your gold portfolio, Goldbacks offer a practical, spendable alternative to traditional gold investments.</p><p>This listing is for 1 Wyoming 1 Goldback Bill. </p><p></p><p>Redemption:</p><p>This listing must be redeemed upon purchase. To redeem the purchased notes, please provide a shipping address and preference for courier or postal delivery. We will provide you with the serial number for each of the notes purchased. Delivery within 14 days. </p><p></p><p>Contact:</p><p>True Precious Metals </p><p>437 907 2400</p><p>info@truepreciousmetals.ca</p>"