  , Asset "Metals" 0x85eb418c47a5d3ceadcc44f6b000aa41f16859f1 "Carbon Neutral Silver - Fractional 100 oz Bars" "<p>Purchase digital ownership of physical silver. Silver offers the benefits of being a safe haven asset as well as a crucial resource for industrial use.The investment-grade bar is one of the most popular types of silver for investors, but weight and storage for security can sometimes be inconvenient or expensive. This is a simple way to invest and build a position in silver. Each bar has a purity of at least .999 and typically carries a lower premium over spot price per ounce than a coin. Each unit is equal to 1 troy oz of .999 silver. This represents fractional ownership of a 100 oz Silver bar. Redemption, the process of requesting physical delivery, is available in 100 oz Bar increments. To request redemption and delivery of a physical 100 oz Silver bar, ownership of 100 units is required. We do not guarantee the brand you will receive. For redemptions and additional information, please contact sales@blockapps.net, fees may apply. Bar Specifics: 1. Contains 100 Troy oz of .999 pure silver. 2. Sourced from secondary markets, these bars are not from a specified mint and feature varied designs and conditions. 3. Authenticity of all the silver bullion guarantee A large majority of Silver Ore is brought to market via secondary sourcing. About 80 percent of silver is discovered as a byproduct from gold, lead, copper, and zinc mining. This impacts the accuracy in calculating the carbon footprint for silver. Current reporting estimates from 2019-2022 have estimated a ton of silver generates about 450-550 tons of carbon dioxide. This Carbon Neutral Mercata Silver has utilized the Mercata Carbon Blended Tonne, a tokenized offset, to reduce nearly 67 kg of carbon per troy ounce of silver. This represents over 2,140 tons of carbon which is offset for each ton of silver, while supporting projects globally across Wind, Solar, Hydro, Agricultural, and BioMass Energy.