nergy. For more information visit: mercatacarbon.com" (0) (fromList [(0,"https://fileserver.mercata-testnet2.blockapps.net/highway/311053f72ecce9ab74f52bbd5b08ab81959a65de34a1deed0d085bb9b0a4f264.png")]) (fromList [(0,"https://fileserver.mercata-testnet2.blockapps.net/highway/b6ec9551f13a9f13c5e95c086a1fd89844ceb728edf5dd2f386a763ae94c0637.pdf")]) (fromList []) (fromList [("isMint","True"),("leastSellableUnits","1"),("mintAddress","884cc837dfb52d23827d6425e2a00020f8cb0be7"),("mintableMagicNumber","5578111059604171877"),("minterAddress","141e73dc8d2dbbda4fba3797527d22be4b2c4744"),("minterCommonName","blockapps_metals"),("purity","999"),("source","Tokeni Inc."),("unitOfMeasurement","3"),("utxoMagicNumber","1431590991")]) (fromList [(0x0cf2df89716076b2e4f989b8b6ffaccc35cf4be3,Balance  0x91dec283d4dd0da0878402bc510efbf1f0c5ee0c 0x0cf2df89716076b2e4f989b8b6ffaccc35cf4be3 "Natasha Hormuzdiar" (0)),(0x0d9acdbb5a8a45424c33a05554f66a251c6d6f43,Balance  0xd3675be4d3f75af2445332f415c7759c472f2db8 0x0d9acdbb5a8a45424c33a05554f66a251c6d6f43 "wderosa" (100)),(0x141e73dc8d2dbbda4fba3797527d22be4b2c4744,Balance  0x884cc837dfb52d23827d6425e2a00020f8cb0be7 0x141e73dc8d2dbbda4fba3797527d22be4b2c4744 "blockapps_metals" (0)),(0x1ffaa1eaab6bc10f81e6f75d6cb757927daf8226,Balance  0xf929454aafa347d15250681f5d82787e58e02e70 0x1ffaa1eaab6bc10f81e6f75d6cb757927daf8226 "andrew" (0)),(0x277663c4e7a46700d113c66ce62e0e9784fc7e1e,Balance  0x0105cc179065f70e9cfd267b67eaba23788b8869 0x277663c4e7a46700d113c66ce62e0e9784fc7e1e "sharonchen" (20)),(0x2ccc879a4b83673119e83fd708a183f56222abfc,Balance  0x7350b020c1a31b25ac840d0ea706de47ef428909 0x2ccc879a4b83673119e83fd708a183f56222abfc "Thomas Nutt-Powell" (1)),(0x316976a5719d5605a0e1c25d6320569ad32234bf,Balance  0x05023591e180e644512024b24e74f56acdb0ea4a 0x316976a5719d5605a0e1c25d6320569ad32234bf "dawgfan122@gmail.com" (0)),(0x36d1a5e80077e0a80e020e54a89c1eb9a9520736,Balance  0xcd36e915c9d806e961adac5d0369299b708949ce 0x36d1a5e80077e0a80e020e54a89c1eb9a95