  , Asset "Metals" 0xc4c027a5cde93e00d63ce0a009b0080b60c2112d "Nevada Goldback" "<p><strong><u>Description:</u></strong></p><p>The <strong><em>Goldback</em></strong> is a unique form of physical gold currency designed for everyday use. It circulates in select states, including Utah, Nevada, Wyoming, New Hampshire, and South Dakota, under local laws.</p><p></p><p>What sets the Goldback apart from other gold products is its use as a currency with interchangeable denominations, rather than relying on varying premiums based on gold content. For instance, the fifty denomination, representing 1/20th of an ounce of gold, can be exchanged for fifty of the one denomination, which is 1/1000th of an ounce.</p><p></p><p>Each Goldback is tied to the value of gold. One Goldback equals 1/1000th of a troy ounce of 24-karat gold, so 1,000 Goldbacks in any combination equals one full ounce of gold. This makes Goldbacks easy to use for small transactions, especially compared to other gold products, which often carry inconsistent premiums and are more challenging to exchange.</p><p>Because of their intrinsic value, Goldbacks can be bartered globally, making them more versatile than traditional gold coins or bars. Their flexibility and ease of use in smaller transactions give them a practical edge over other forms of physical gold. If you're considering adding to your gold portfolio, Goldbacks offer a practical, spendable alternative to traditional gold investments.</p><p></p><p><strong><u>Redemption:</u></strong></p><p>To redeem a purchased note, please provide a shipping address and preference for courier or postal delivery. We will provide you with the serial number for each of the notes purchased.</p><p></p><p><strong><u>Resales:</u></strong></p><p>There are no future royalties or sell on fees if you choose to resell a note using Mercata Marketplace. <strong>There is a minimum sale price of $6.50 USD for each note. Please refer to the spot price and exchange rate provided by Goldback at </strong><a target=\\\"_blank\\\" rel=\\\"noopener noreferrer nofollow\\\" href=\\\"https://www.goldback.com/exchange-rate\\\"><strong>https://www.goldback.com/exchange-rate</strong></a></p>" (0) (fromList [(0,"https://fileserver.mercata.blockapps.net/highway/ed7b4529e5e68ca3ef169378dbad52fb3b9400efa11970701df0e69bd06b47f5.png")]) (fromList []) (fromList []) (fromList [("isMint","True"),("leastSellableUnits","10"),("mintAddress","c4c027a5cde93e00d63ce0a009b0080b60c2112d"),("mintableMagicNumber","5578111059604171877"),("minterAddress","a74224f55fcf9d045edcbf738ebfcf62f40515cb"),("minterCommonName","Tyson Rose"),("purity",".9999"),("redeemableMagicNumber","389104407046652472487013"),("redemptionService","85e6364f9105e21e7cfc18495303fc74257303dd"),("source","Gold"),("unitOfMeasurement","3"),("utxoMagicNumber","1431590991")]) (fromList [(0xa74224f55fcf9d045edcbf738ebfcf62f40515cb,Balance  0xc4c027a5cde93e00d63ce0a009b0080b60c2112d 0xa74224f55fcf9d045edcbf738ebfcf62f40515cb "Tyson Rose" (5))])
