  , Asset "Spirits" 0x0027b1bae9141f484d66675be79d41c4e27c8a5c "The Three for the Money Collection - Whiskey Casks" "<p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">The Three for the Money Collection from Connecticut Distilling and BlockApps, offers a special opportunity for whiskey enthusiasts and investors alike.</span><br></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">This features a carefully crafted whiskey blend composed of 51 percent corn, 21 percent rye, and 28 percent malted barley, aged in new American Oak casks.</span><br></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">The release offers:</span></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">1. Limited Availability: This collection is produced in limited quantities, ensuring exclusivity.</span></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">2. Premium Quality: The use of high-quality grains and careful aging promises an exceptional flavor profile.</span></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">3. Potential for Appreciation: Like wine, premium whiskeys can increase in value as they mature and become more rare and unique.</span></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">4. Collectibility: Releases from respected distilleries often become highly sought-after by collectors, further enhancing the potential value.</span></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">5. Diversification: For those seeking to diversify their portfolio, whiskey investing can provide an alternative asset class with low correlation and a history of value growth.</span></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">Whiskey enthusiasts can secure a piece of modern history as demand for premium, limited-edition whiskeys continues to rise in the years to come.</span><br></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">The Specifics:<br>For the first time BlockApps is offering the opportunity to purchase fractionalized shares of individual casks (barrels) of whiskey. <br><br>Each cask is 200 liters of whiskey at the time of production. There are 200 fractionalized shares per cask, each offered at a price of $9. Each fractionalized share equals 0.5% ownership (1/200th) of a cask of whiskey. Any number of shares may be purchased per cask.<br><br>Storage: 2 years of cask storage are included with purchase.</span></p><p></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">Each cask will be produced after all shares of said cask are purchased.<br><br>A Purchase Agreement will be held by BlockApps for all buyers of each fractionalized cask.</span></p><p></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">About Connecticut Distilling:</span></p><p><span style=\\\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11pt; color: rgb(0, 0, 0)\\\">Connecticut Distilling is more than just a distillery; it's a craft revolution. From a childhood steeped in Nashville's whiskey culture to a Master\8217s in Chemistry, Master Distiller Brandon Collins's unique journey infuses every bottle. Here, the art of distillation transcends tradition, transforming brewery byproducts into exceptional whiskeys. At Connecticut Distilling, we celebrate the alchemy of transforming beer into whiskey through sustainable practices and innovative techniques, as well as making and aging other classic spirits \8212 aged bourbon, vodka, rum, and even grappa. Experience the magic of craft distillation with us and discover how we blend passion, community, and conservation into every sip. Connecticut Distilling. Craft, reborn.</span></p><p><br></p>" (0) (fromList [(0,"https://fileserver.mercata.blockapps.net/highway/6df710c7c05cee76c1faba1c73666cd20f9fa43d965c8da3bcd5029707bfc83a.jpg")]) (fromList []) (fromList []) (fromList [("isMint","True"),("mintAddress","0027b1bae9141f484d66675be79d41c4e27c8a5c"),("mintableMagicNumber","5578111059604171877"),("minterAddress","c7047324847e354af802e11e85eefe8e86d2c674"),("minterCommonName","blockapps_spirits"),("redeemableMagicNumber","389104407046652472487013"),("redemptionService","85e6364f9105e21e7cfc18495303fc74257303dd"),("spiritType","Whiskey"),("unitOfMeasurement","1"),("utxoMagicNumber","1431590991")]) (fromList [(0x6ec8bbe4a5b87be18d443408df43a45e5972fa1b,Balance  0x5bcd114095ea272fd308e7145c6737d36fc2cd37 0x6ec8bbe4a5b87be18d443408df43a45e5972fa1b "burner" (200)),(0xc7047324847e354af802e11e85eefe8e86d2c674,Balance  0x0027b1bae9141f484d66675be79d41c4e27c8a5c 0xc7047324847e354af802e11e85eefe8e86d2c674 "blockapps_spirits" (0))])
  , Asset "Spirits" 0x0a369d3d895e3fa92143ae31816cb7df6f987589 "The Inaugural Collection - Whiskey Cask" "<p>The Inaugural Collection from Connecticut Distilling, in partnership with BlockApps, offers a special opportunity for whiskey enthusiasts and investors alike.</p><p><br>This features a carefully crafted whiskey blend composed of 51 percent corn, 21 percent rye, and 28 percent malted barley, aged in new American Oak casks.</p><p><br>The release offers:</p><ol><li><p><em>Limited Availability</em>: As an inaugural offering, this collection is produced in limited quantities, ensuring exclusivity.</p></li><li><p><em>Premium Quality</em>: The use of high-quality grains and careful aging promises an exceptional flavor profile.</p></li><li><p><em>Potential for Appreciation</em>: Like wine, premium whiskeys can increase in value as they mature and become more rare and unique.</p></li><li><p><em>Collectibility</em>: Inaugural releases from respected distilleries often become highly sought-after by collectors, further enhancing the potential value.</p></li><li><p><em>Diversification</em>: For those seeking to diversify their portfolio, whiskey investing can provide an alternative asset class with low correlation and a history of value growth.</p><p></p></li></ol><p>Whiskey enthusiasts can secure a piece of modern history as demand for premium, limited-edition whiskeys continues to rise in the years to come.</p><p></p><p>The Specifics:</p><p>Purchase: provides ownership of the selected quantity of whiskey casks.</p><p>Storage: 2 years of cask storage are included with purchase.</p><p></p><p>For questions and additional information please contact: sales@blockapps.net</p><p></p><p>About Connecticut Distilling:</p><p><br>Connecticut Distilling is more than just a distillery; it's a craft revolution. From a childhood steeped in Nashville's whiskey culture to a Master\8217s in Chemistry, Master Distiller Brandon Collins's unique journey infuses every bottle. Here, the art of 